import React, { Component } from 'react';
import Image from '../../../images/img_avatar.png';

class Header extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-light bg-light p-0 row">
                    <div className="col-md-2 bg-primary w-100 text-center py-0">
                        <div className="row">
                        <div className="col-md-1 my-auto"><img src={Image} width="30" height="30" className="rounded-circle my-auto pt-0"/></div>
                        <div className="col"><span class="navbar-brand mb-0 h1 text-light mx-auto">Student Name</span></div>
                        
                        </div>
                        </div>
                    <div className="col-md-10"></div>
                    
                </nav>

            </div>
        );
    }
}

export default Header;
